CREATE TABLE IF NOT EXISTS userTable (
    `firstName` VARCHAR(11) CHARACTER SET utf8,
    `lastName` VARCHAR(9) CHARACTER SET utf8,
    `Age` INT,
    `Location` VARCHAR(16) CHARACTER SET utf8,
    `Income` INT,
    `Grocery` NUMERIC(5, 1),
    `Dine_Out` NUMERIC(5, 1),
    `Alcohol` NUMERIC(4, 1),
    `Housing` NUMERIC(5, 1),
    `Apparel_and_services` NUMERIC(5, 1),
    `Transportation` NUMERIC(6, 1),
    `Health_care` NUMERIC(5, 1),
    `entertainment` NUMERIC(5, 1),
    `Personel_care` NUMERIC(4, 1),
    `Education` NUMERIC(5, 1),
    `Miscallaneous` NUMERIC(5, 1),
    `Donations` NUMERIC(5, 1),
    `Insurance` NUMERIC(5, 1)
);

